@Override
public Cell getCell(Point p, int level) {
  List<Cell> cells = new ArrayList<>(1);
  build(xmid, ymid, 0, cells, 0x0L, ctx.makePoint(p.getX(), p.getY()), level);
  return cells.get(0);//note cells could be longer if p on edge
}

